    <script type="application/ld+json">{"@context":"http://schema.org/","@type":"Dataset","name":"Fashion MNIST","description":"### Context\n\nFashion-MNIST is a dataset of Zalando's article images—consisting of a training set of 60,000 examples and a test set of 10,000 examples. Each example is a 28x28 grayscale image, associated with a label from 10 classes. Zalando intends Fashion-MNIST to serve as a direct drop-in replacement for the original MNIST dataset for benchmarking machine learning algorithms. It shares the same image size and structure of training and testing splits.\n\nThe original MNIST dataset contains a lot of handwritten digits. Members of the AI/ML/Data Science community love this dataset and use it as a benchmark to validate their algorithms. In fact, MNIST is often the first dataset researchers try. \"If it doesn't work on MNIST, it won't work at all\", they said. \"Well, if it does work on MNIST, it may still fail on others.\"\n\nZalando seeks to replace the original MNIST dataset\n\n### Content\n\nEach image is 28 pixels in height and 28 pixels in width, for a total of 784 pixels in total. Each pixel has a single pixel-value associated with it, indicating the lightness or darkness of that pixel, with higher numbers meaning darker. This pixel-value is an integer between 0 and 255. The training and test data sets have 785 columns. The first column consists of the class labels (see above), and represents the article of clothing. The rest of the columns contain the pixel-values of the associated image.\n\n- To locate a pixel on the image, suppose that we have decomposed x as x = i * 28 + j, where i and j are integers between 0 and 27. The pixel is located on row i and column j of a 28 x 28 matrix. \n- For example, pixel31 indicates the pixel that is in the fourth column from the left, and the second row from the top, as in the ascii-diagram below.\n<br><br>\n\n\n**Labels**\n\nEach training and test example is assigned to one of the following labels:\n\n- 0\tT-shirt/top\n- 1\tTrouser\n- 2\tPullover\n- 3\tDress\n- 4\tCoat\n- 5\tSandal\n- 6\tShirt\n- 7\tSneaker\n- 8\tBag\n- 9\tAnkle boot\n<br><br>\n\nTL;DR\n\n- Each row is a separate image  \n- Column 1 is the class label. \n- Remaining columns are pixel numbers (784 total). \n- Each value is the darkness of the pixel (1 to 255)\n\n### Acknowledgements\n\n- Original dataset was downloaded from [https://github.com/zalandoresearch/fashion-mnist][1]\n\n- Dataset was converted to CSV with this script: [https://pjreddie.com/projects/mnist-in-csv/][2]\n\n### License\n\nThe MIT License (MIT) Copyright © [2017] Zalando SE, https://tech.zalando.com\n\nPermission is hereby granted, free of charge, to any person obtaining a copy of this software and associated documentation files (the “Software”), to deal in the Software without restriction, including without limitation the rights to use, copy, modify, merge, publish, distribute, sublicense, and/or sell copies of the Software, and to permit persons to whom the Software is furnished to do so, subject to the following conditions:\n\nThe above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.\n\nTHE SOFTWARE IS PROVIDED “AS IS”, WITHOUT WARRANTY OF ANY KIND, EXPRESS OR IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE AUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER LIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM, OUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN THE SOFTWARE.\n\n  [1]: https://github.com/zalandoresearch/fashion-mnist\n  [2]: https://pjreddie.com/projects/mnist-in-csv/","url":"https://www.kaggle.comzalando-research/fashionmnist","sameAs":"https://staging.kaggle.com/zalando-research/fashionmnist","version":4,"keywords":["data type > image data","problem type > multiclass c s/952/thumbnail.jpg%3Fr=897","isOrganization":true,"name":"Zalando Research","profileUrl":"/zalando-research","slug":"zalando-research","maxFileSizeBytes":null,"userTier":null}],"referrer":null,"canSeeDatasetWorker":true,"canChangePrivacy":true,"canConvertCsvFormat":false,"convertToStandardCsvFormat":false,"title":"Fashion MNIST","slug":"fashionmnist","licenseId":12,"data":{"id":9243,"databundleId":2243,"databundleVersionType":"fileset","versionNumber":4,"zipBlobFileId":359086,"totalSize":72149861,"ownerInfo":{"databundleVersionId":9243,"dataset":{"datasetId":2243,"datasetVersionId":9243}},"name":"Fashion MNIST","description":"### Context\n\nFashion-MNIST is a dataset of Zalando\u0027s article images—consisting of a training set of 60,000 examples and a test set of 10,000 examples. Each example is a 28x28 grayscale image, associated with a label from 10 classes. Zalando intends Fashion-MNIST to serve as a direct drop-in replacement for the original MNIST dataset for benchmarking machine learning algorithms. It shares the same image size and structure of training and testing splits.\n\nThe original MNIST dataset contains a lot of handwritten digits. Members of the AI/ML/Data Science community love this dataset and use it as a benchmark to validate their algorithms. In fact, MNIST is often the first dataset researchers try. \u0022If it doesn\u0027t work on MNIST, it won\u0027t work at all\u0022, they said. \u0022Well, if it does work on MNIST, it may still fail on others.\u0022\n\nZalando seeks to replace the original MNIST dataset\n\n### Content\n\nEach image is 28 pixels in height and 28 pixels in width, for a total of 784 pixels in total. Each pixel has a single pixel-value associated with it, indicating the lightness or darkness of that pixel, with higher numbers meaning darker. This pixel-value is an integer between 0 and 255. The training and test data sets have 785 columns. The first column consists of the class labels (see above), and represents the article of clothing. The rest of the columns contain the pixel-values of the associated image.\n\n- To locate a pixel on the image, suppose that we have decomposed x as x = i * 28 + j, where i and j are integers between 0 and 27. The pixel is located on row i and column j of a 28 x 28 matrix. \n- For example, pixel31 indicates the pixel that is in the fourth column from the left, and the second row from the top, as in the ascii-diagram below.\n\u003cbr\u003e\u003cbr\u003e\n\n\n**Labels**\n\nEach training and test example is assigned to one of the following labels:\n\n- 0\tT-shirt/top\n- 1\tTrouser\n- 2\tPullover\n- 3\tDress\n- 4\tCoat\n- 5\tSandal\n- 6\tShirt\n- 7\tSneaker\n- 8\tBag\n- 9\tAnkle boot\n\u003cbr\u003e\u003cbr\u003e\n\nTL;DR\n\n- Each row is a separate image  \n- Column 1 is the class label. \n- Remaining columns are pixel numbers (784 total). \n- Each value is the darkness of the pixel (1 to 255)\n\n### Acknowledgements\n\n- Original dataset was downloaded from [https://github.com/zalandoresearch/fashion-mnist][1]\n\n- Dataset was converted to CSV with this script: [https://pjreddie.com/projects/mnist-in-csv/][2]\n\n### License\n\nThe MIT License (MIT) Copyright © [2017] Zalando SE, https://tech.zalando.com\n\nPermission is hereby granted, free of charge, to any person obtaining a copy of this software and associated documentation files (the “Software”), to deal in the Software without restriction, including without limitation the rights to use, copy, modify, merge, publish, distribute, sublicense, and/or sell copies of the Software, and to permit persons to whom the Software is furnished to do so, subject to the following conditions:\n\nThe above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.\n\nTHE SOFTWARE IS PROVIDED “AS IS”, WITHOUT WARRANTY OF ANY KIND, EXPRESS OR IMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT
